    state = {
        open: false
    };
    handleClickOpen = () => {
        this.setState({open: true});
        ScrollAnim
            .scrollScreen
            .unMount();
    };
    handleClose = () => {
        this.setState({open: false});
        ScrollAnim
            .scrollScreen
            .init({loop: false, duration: 1200, ease: "easeInOutQuart", scrollInterval: 800});
    };
