                        key="0"
                        animation={{
                        delay: 200,
                        duration: 0,
                        translateY: 0,
                        opacity: 1
                    }}
                        style={{
                        transform: 'translateY(0px)',
                        opacity: 0
                    }}>
                        <h2>{i.h2}</h2>
                        <div>{i.descricao}</div>
                        <Button
                            style={{
                            position: 'fixed',
                            zIndex: '9999',
                            top: '1em',
                            right: '1em'
                        }}
                            onClick={this.handleClickOpen}>
                            Open full - screen dialog
                        </Button>
                    </TweenOne>
                    <Dialog
                        fullScreen
                        scroll={this.state.scroll}
                        open={this.state.open}
                        onClose={this.handleClose}
                        style={{
                        backgroundColor: '#ffffff'
                    }}>
                        <IconButton
                            style={{
                            position: 'fixed',
                            zIndex: '9999',
                            top: '1em',
                            right: '1em',
                            backgroundColor: '#f0f0f0'
                        }}
                            color="inherit"
                            onClick={this.handleClose}>
                            <CloseIcon/>
                        </IconButton>
                        <div className={"tween-one"}>
                            <h2>{i.h2}</h2>
                            <div>{i.descricao}</div>
                            <p>
                                jahaja
                            </p>
                        </div>
                    </Dialog>
                </ScrollOverPack>))
